import React, { useRef, props } from "react";

const imageRef = useRef(null);

const ImageToggle = (props) => {
  return (
    <img
      src={props.primaryImgSrc}
      width="500px"
      height="500px"
      alt={props.alt}
    />
  );
};

export default ImageToggle;
